import React from 'react';
import './App.css';
import Post from './Post';

function App() {
  return (
    <div className="App">

      <div className="app_header">
        <img
          className="app_headerImage"
          src="{imageUrl}"
          alt=""
        />
      </div>

      <Post username="samia_rekhi" caption="React" imageUrl="https://www.freecodecamp.org/news/content/images/size/w2000/2020/02/Ekran-Resmi-2019-11-18-18.08.13.png" />
      <Post username="rejtsharma" caption="OP" />
      <Post username="jaivirsrekhi" caption="Wow! It works!"/>
    </div>
  );
}

export default App;
